import logo from './logo.png';
import './App.css';

function App() {
  return (
    <div className="App" style={{backgroundColor : 'yellow'}}>
      <header className="App-header" style={{backgroundColor : '#996622'}}>
        <img src={logo} className="" alt="logo" />
        <p>
          Visualise your internet footprint
        </p>

        <p>
          Coming soon...
        </p>
      </header>
    </div>
  );
}

export default App;
